import React from 'react';
import './App.css';
import NFTGenerator from './components/NFTGenerator';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>AI NFT Generator</h1>
        <p>Connect your wallet and generate unique AI-powered NFTs</p>
      </header>
      <main>
        <NFTGenerator />
      </main>
    </div>
  );
}

export default App;
